import styled from 'styled-components';

export const MainBlock = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -40%);
  background-color: white;
  border-radius: 16px;
  box-shadow: 0 0 10px 0 rgba(0, 0, 0, 0.3);
  width: 25rem;
  height: 35rem;
  padding: 0 1.2rem;
  overflow-y: auto;
`;
